BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS questions (id INTEGER PRIMARY KEY, question TEXT, optionA TEXT, optionB TEXT, optionC TEXT, optionD TEXT, answer_index INTEGER);
CREATE TABLE IF NOT EXISTS users (id INTEGER PRIMARY KEY, email TEXT, password TEXT, username TEXT);
CREATE TABLE IF NOT EXISTS submissions (id INTEGER PRIMARY KEY AUTOINCREMENT, user_email TEXT, timestamp TEXT, total_questions INTEGER, attempted INTEGER, not_answered INTEGER, correct INTEGER, wrong INTEGER, marks INTEGER, answers TEXT);
COMMIT;